import React, { useEffect, useState, Component } from "react";
import axios from 'axios';



import {
    ComposedChart,
    Line,
    Area,
    Bar,
    XAxis,
    YAxis,
    CartesianGrid,
    Tooltip,
    Legend,
    Scatter,
    ResponsiveContainer,
    ErrorBar
  } from 'recharts';


  const data = [
    {
      name: 'Page A',
      uv: 590,
      pv: 800,
      amt: 1400,
      cnt: 490,
    },
    {
      name: 'Page B',
      uv: 868,
      pv: 967,
      amt: 1506,
      cnt: 590,
    },
    {
      name: 'Page C',
      uv: 1397,
      pv: 1098,
      amt: 989,
      cnt: 350,
    },
    {
      name: 'Page D',
      uv: 1480,
      pv: 1200,
      amt: 1228,
      cnt: 480,
    },
    {
      name: 'Page E',
      uv: 1520,
      pv: 1108,
      amt: 1100,
      cnt: 460,
    },
    {
      name: 'Page F',
      uv: 1400,
      pv: 680,
      amt: 1700,
      cnt: 380,
    },
  ];

const data1 = [
    {name: 'Week 1', max: 4000, min: 1400, error: [200, 1000]},
    {name: 'Week 2', max: 4000, min: 3400, errorNegative: [1000, 200]},
    {name: 'Week 3', max: 3200, min: 2400, errorNegative: [1000, 200]},
    {name: 'Week 4', max: 1000, min: 400, error: [200, 1000]},
    {name: 'Week 5', max: 2000, min: 1100, error: [200, 1000]},
    {name: 'Week 6', max: 3000, min: 400, error: [-200, 2000]},
    {name: 'Week 7', max: 500, min: -1000, error: [200, 2000]},
];

export default function MainGraph(props) {


  return (
        <ResponsiveContainer width="100%" height="100%">
          <ComposedChart
            width={500}
            height={400}
            data={data}
            margin={{
              top: 20,
              right: 20,
              bottom: 20,
              left: 20,
            }}
          >
            <CartesianGrid stroke="#f5f5f5" />
            <XAxis dataKey="name" scale="band" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Area type="monotone" dataKey="amt" fill="#8884d8" stroke="#8884d8" />
            <Bar dataKey="pv" barSize={20} fill="#413ea0" />
            <Line type="monotone" dataKey="uv" stroke="#ff7300" />
            <Scatter dataKey="cnt" fill="red" />
            <Bar barSize={30} data={data1}   dataKey="max" fill="#035aa6" />
            <Bar barSize={35} data={data1}  dataKey='min' fill="black">
              <ErrorBar data={data1} dataKey="error" width={4} strokeWidth={2} stroke="#66c208" />
              <ErrorBar  dataKey="errorNegative" width={4} strokeWidth={2} stroke="#ff0044" />
            </Bar>
          </ComposedChart>
        </ResponsiveContainer>
  );
}


function mapStateToProps(state) {
  return {
    dataAO: state.remoteAOData
  };
}
